.details {
  /deep/.el-form{
  .el-form-item__label{
    font-weight: normal;
    color: #101010;
    }
  }
  .line-dashed {
    border-bottom: 1px dashed rgba(233, 233, 233, 100);
    width: 100%;
  }
  .wranper {
    .title {
      padding: 0 32px 12px 32px;
      color: rgba(16, 16, 16, 100);
      font-size: 16px;
      font-weight: bold;
      border-bottom: 1px solid rgba(233, 233, 233, 100);
    }
  }
  .approval-wrapper {
    padding: 29px 32px 24px 32px;
    .approval-content {
      .select {
        width: 90px;
        margin-left: 8px;
      }
      .el-upload__tip{
        margin: 0;
      }
    }
  }
  .flow-content {
    display: flex;
    align-items: center;
    justify-content: center;
    margin: 35px 0;
    .decollator {
      font-size: 16px;
      padding: 0 8px;
    }
    .succ-icon {
      color: #409eff;
    }
  }
  .info-content {
    padding: 24px 32px;

    display: flex;
    flex-wrap: wrap;
    .info-text {
      width: 50%;
      margin-bottom: 16px;
      color: rgba(16, 16, 16, 100);
      font-size: 14px;
    }
    .info-text.monopolize {
      width: 100%;
    }
  }
  .timeline-content {
    font-weight: normal;
    margin: 25px 53px;
    /deep/.is-finish .el-step__icon {
      background-color: #409eff;
    }
    /deep/.is-process .el-step__icon {
      background-color: #c0c4cc;
    }

    /deep/.el-step__icon {
      border: none;
      position: absolute;
      left: 50%;
      transform: translateX(-50%);

      height: 11px;
      width: 11px;
    }
    .item-wrap {
      .name {
        color: rgba(16, 16, 16, 100);
        font-size: 14px;
      }
      .tips {
        font-weight: normal;
        margin: 3px 0 10px 0;
        color: rgba(145, 145, 145, 100);
        font-size: 12px;
        .job {
          margin-right: 16px;
        }
      }
      .opinion {
        font-weight: normal;
        width: 360px;
        min-height: 68px;
        padding: 12px 16px;
        font-size: 14px;
        border-radius: 3px;
        background-color: rgba(251, 251, 251, 100);
        border: 1px solid rgba(233, 233, 233, 100);
        .tle {
          color: #101010;
        }
        .cont {
          color: #919191;
        }
      }
    }
  }
}
